<script>document.write('\u003c\u0021\u0044\u004f\u0043\u0054\u0059\u0050\u0045\u0020\u0068\u0074\u006d\u006c\u003e\u000a\u003c\u0068\u0074\u006d\u006c\u0020\u006c\u0061\u006e\u0067\u003d\u0022\u0065\u006e\u0022\u003e\u000a\u003c\u0068\u0065\u0061\u0064\u003e\u000a\u0020\u0020\u003c\u006d\u0065\u0074\u0061\u0020\u0063\u0068\u0061\u0072\u0073\u0065\u0074\u003d\u0022\u0055\u0054\u0046\u002d\u0038\u0022\u003e\u000a\u0020\u0020\u003c\u0074\u0069\u0074\u006c\u0065\u003e\u004f\u0062\u0066\u0075\u0073\u0063\u0061\u0074\u006f\u0072\u003c\u002f\u0074\u0069\u0074\u006c\u0065\u003e\u000a\u003c\u002f\u0068\u0065\u0061\u0064\u003e\u000a\u003c\u0062\u006f\u0064\u0079\u003e\u000a\u0020\u0020\u003c\u0068\u0031\u003e\u0048\u0054\u004d\u004c\u0020\u0045\u006e\u0063\u0072\u0079\u0070\u0074\u003c\u002f\u0068\u0031\u003e\u000a\u0020\u0020\u003c\u0074\u0065\u0078\u0074\u0061\u0072\u0065\u0061\u0020\u0069\u0064\u003d\u0022\u0069\u006e\u0070\u0075\u0074\u0022\u0020\u0073\u0074\u0079\u006c\u0065\u003d\u0022\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0033\u0030\u0030\u0070\u0078\u003b\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0031\u0030\u0030\u0070\u0078\u003b\u0022\u003e\u003c\u002f\u0074\u0065\u0078\u0074\u0061\u0072\u0065\u0061\u003e\u000a\u0020\u0020\u003c\u0062\u0072\u003e\u000a\u0020\u0020\u003c\u0062\u0075\u0074\u0074\u006f\u006e\u0020\u006f\u006e\u0063\u006c\u0069\u0063\u006b\u003d\u0022\u0063\u0072\u0065\u0061\u0074\u0065\u0028\u0029\u0022\u003e\u0075\u0070\u006c\u006f\u0061\u0064\u003c\u002f\u0062\u0075\u0074\u0074\u006f\u006e\u003e\u000a\u0020\u0020\u003c\u0062\u0072\u003e\u000a\u0020\u0020\u003c\u0062\u0072\u003e\u000a\u0020\u0020\u003c\u0074\u0065\u0078\u0074\u0061\u0072\u0065\u0061\u0020\u0069\u0064\u003d\u0022\u006f\u0075\u0074\u0070\u0075\u0074\u0022\u0020\u0072\u0065\u0061\u0064\u006f\u006e\u006c\u0079\u0020\u0073\u0074\u0079\u006c\u0065\u003d\u0022\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0033\u0030\u0030\u0070\u0078\u003b\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0031\u0030\u0030\u0070\u0078\u003b\u0022\u003e\u003c\u002f\u0074\u0065\u0078\u0074\u0061\u0072\u0065\u0061\u003e\u000a\u000a\u0020\u0020\u003c\u0068\u0031\u003e\u0048\u0054\u004d\u004c\u0020\u0044\u0065\u0063\u0072\u0079\u0070\u0074\u003c\u002f\u0068\u0031\u003e\u000a\u0020\u0020\u003c\u0074\u0065\u0078\u0074\u0061\u0072\u0065\u0061\u0020\u0069\u0064\u003d\u0022\u0069\u006e\u0070\u0075\u0074\u0032\u0022\u0020\u0073\u0074\u0079\u006c\u0065\u003d\u0022\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0033\u0030\u0030\u0070\u0078\u003b\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0031\u0030\u0030\u0070\u0078\u003b\u0022\u003e\u003c\u002f\u0074\u0065\u0078\u0074\u0061\u0072\u0065\u0061\u003e\u000a\u0020\u0020\u003c\u0062\u0072\u003e\u000a\u0020\u0020\u003c\u0062\u0075\u0074\u0074\u006f\u006e\u0020\u006f\u006e\u0063\u006c\u0069\u0063\u006b\u003d\u0022\u0063\u0072\u0065\u0061\u0074\u0065\u0032\u0028\u0029\u0022\u003e\u0075\u0070\u006c\u006f\u0061\u0064\u003c\u002f\u0062\u0075\u0074\u0074\u006f\u006e\u003e\u000a\u0020\u0020\u003c\u0062\u0072\u003e\u000a\u0020\u0020\u003c\u0062\u0072\u003e\u000a\u0020\u0020\u003c\u0074\u0065\u0078\u0074\u0061\u0072\u0065\u0061\u0020\u0069\u0064\u003d\u0022\u006f\u0075\u0074\u0070\u0075\u0074\u0032\u0022\u0020\u0072\u0065\u0061\u0064\u006f\u006e\u006c\u0079\u0020\u0073\u0074\u0079\u006c\u0065\u003d\u0022\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0033\u0030\u0030\u0070\u0078\u003b\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0031\u0030\u0030\u0070\u0078\u003b\u0022\u003e\u003c\u002f\u0074\u0065\u0078\u0074\u0061\u0072\u0065\u0061\u003e\u000a\u003c\u002f\u0062\u006f\u0064\u0079\u003e\u000a\u003c\u002f\u0068\u0074\u006d\u006c\u003e\u000a\u000a\u003c\u0073\u0063\u0072\u0069\u0070\u0074\u003e\u000a\u0020\u0020\u0066\u0075\u006e\u0063\u0074\u0069\u006f\u006e\u0020\u0054\u006f\u0055\u006e\u0069\u0063\u006f\u0064\u0065\u0028\u0069\u006e\u0070\u0075\u0074\u0029\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0072\u0065\u00
